subSection.paragraph:
Delma australis
as currently circumscribed is widespread across southern Australia , inhabiting a variety of semi-arid to arid habitats in Western Australia (W.A.), South Australia (S.A.), Victoria (Vic.) and New South Wales (N.S.W.) (
Kluge 1974
;
Ehmann 1992
;
Wilson & Swan 2013
). Geographic variation has been observed in the intensity of head patterning and in head form (
Shea 1991
;
Aplin & Smith 2001
), and several authors have suggested that
D. australis
may contain more than one species (
Aplin & Smith 2001
;
Wilson & Swan 2013
).
Aplin & Smith ( 2001 : 70 )
nominated a distinctive sub-population from the southern most parts of W.A. as a probable undescribed species, but the presence of morphological variation among other populations of
D. australis
hindered description of this one sub-population.

All sequences were aligned by eye, and protein-coding loci were translated to amino acid sequence to maintain proper reading frames and avoid premature stop codons. Transfer RNA (tRNA) secondary structure was addressed and aligned by eye for consistency. Mitochondrial genes were analysed together because of shared evolutionary history as the result of physical linkage. Although trees produced for the combined mitochondrial genes and each nuclear locus exhibited varying degrees of support, the topologies are largely compatible, with no instances of strong conflict. Recognizing congruence between mitochondrial and nuclear datasets, all loci were concatenated into a single mito-nuclear dataset which produced a well-supported evolutionary hypothesis. Final aligned sequences stretched 5,574 bp ( 16 S– 796 , ND 2–1480 , DYNLL 1–1056 , MXRA 5–793 , RAG 1–1071 , C-mos– 378 ) respectively. We used maximum likelihood (ML) and Bayesian inference ( BI ) methods to test for conflict between topologies and support values between analytical programs. ML and BI results returned largely concordant topologies, with comparable Bayesian posterior probability (BPP) and bootstrap support (BSS) values across all datasets. We used the Akaike Information Criterion in jModeltest 2 (
Guindon & Gascuel 2003
;
Darriba et al. 2012
) to identify the most accurate models of evolution for each gene and codon position (Table 2 ).

We used the CIPRES Science Gateway VERSUS 3.3 (
Miller et al. 2010
) as a portal for running all sequencedbased phylogenetic analyses. We used RAxML 8.0 (
Stamatakis 2014
) for ML analyses, and divided the mitonuclear dataset into seven partitions; the mitochondrial into three — ND 2 , tRNA, and 16 S; and the nuclear into four — DYNLL 1 , MXRA 5 , RAG 1 , and C-mos. When analysed independently, individual loci were not partitioned by codon position because of RAxML’s limits on evolutionary models, and both individual and concatenated datasets were instead analyzed under GTR+I+Γ. Topology estimates used 100 independent tree searches, and 5000 bootstrap replicates to retrieve support values.

BI analyses were performed using MrBayes 3.2 (
Huelsenbeck & Ronquist 2001
;
Ronquist et al. 2012
). The mitochondrial dataset was divided into six partitions — ND 2 , ND 2 codons ( 1 st, 2 nd, 3 rd), tRNA, and 16 S; and the nuclear dataset into 13 partitions, each gene receiving 4 partitions (whole locus, three codon positions), with the exception of the non-protein coding nuclear intron DYNLL 1 (unpartitioned). Three versus six partitions for mtDNA and four versus thirteen partitions for nDNA returned identical topologies and did not significantly disrupt BPP support values. We executed two parallel (two heated and two cold chain) runs for 200 million generations sampled every 1000 generations, with sampling from the first 20 million generations discarded as burn-in.

For the purpose of this study the following linear measurements reported in millimetres (mm) were taken with digital calipers or plastic ruler: snout-vent length (
SVL
) measured from tip of snout to vent, tail length (TL) measured from tip of tail to vent and including both potentially original and regenerated tails (see further comments below), head depth (HD) measured from dorsal surface of head and ventral surface of throat at point immediately behind eye, head length (HL) measured from tip of snout to posterior margin of ear, head width (HW) measured from a point between the ears, hindlimb length (
HLL
) measured from junction of limb flap with body to distal tip of flap, mouth length (ML) measured from tip of snout to extreme angle of mouth (determined by probe of calipers under the upper lip and moving posteriorly), rostral length (RL) measured from midline anterior to posterior point of scale, rostral width (RW) measured across from lateral extremities of scale, snout length (SL) measured from tip of snout to anterior margin of transparent spectacle and eye width (EW) horizontal distance measured from anterior to posterior extremities of transparent spectacle (measurement not including the circumocular granules). Three meristic counts were taken: number of hindlimb scales (
HLS
) counted from distal extreme and origin with body, number of midbody scale rows (
MSR
) counted completely midway around body and number of ventrals (
VE
) counted from immediately behind mental scale to vent. Specimens preserved in a circular or twisted position were straightened on a flat surface when measured for snout-vent and tail length.

Based on these results, inter-populational contrasts were carried out separately for each sex for SVL , VE , HLL , HLS and EW and on combined-sex samples for all other variables. Significantly unequal variances were present in two cases only—the female sample for SVL and the male sample for HLS . ANOVA results (
Table 7
) identify overall significant inter-populational variation in SVL (males; females not tested), VE (both sexes), HLL (males only), HLS (females; males not tested), HD (sexes pooled), ML (sexes pooled), SL (sexes pooled), RL (sexes pooled), and RW (sexes pooled). EW alone showed no significant contrasts (sexes tested separately).

