After more than 40 years in preservative (
Fig. 6
), the holotype is light brown on the dorsal surface with a slightly darker head bearing dense black variegations. Lower labials whitish with distinct black bars positioned centrally on first to third lower labial scales. Black bars continue on to corner of mouth, around ear opening and on the lateral scales of forebody. A faint dark bar is also present within mental scale. Dark bars extend ventrally onto chin and throat. Ventral surface under head and along body is whitish.

Distribution and sympatry.
Delma australis
is widespread throughout the subhumid to arid areas of southern Australia , from northwestern Victoria, and southwestern New South Wales , through most of South Australia and adjacent southern Northern Territory to southern and central west Western Australia (
Wilson & Knowles 1988
;
Shea 1991
;
Swan et al. 2004
;
Wilson & Swan 2013
;
Fig. 8
). In Western Australia , it extends north to Shark Bay (base of Peron Peninsula), Meedo Station, Weld Range, Paynes Find, Windarling Hill and Buningonia Spring, south through the Avon Wheatbelt, Mallee and Coolgardie Goldfields bioregions, and east to Cocklebiddy. There is a disjunct population on the North West Cape, represented by a single specimen from Shothole Canyon in the Cape Range (
Fig. 8
). Other possible outlier populations in the mid-west of Western Australia are Walyering Hill, Oakajee and near Kalbarri. Insular populations occur on Rat and Middle Islands in the Houtman Abrolhos.

In preservative, due to the leaching of colours in ethanol after 14 years, the holotype (
Fig. 9
) has lost the grey colouration on the dorsal surface which is now light brown. All other aspects of dark bars or smudges on lower labials and obscure variegations on body remained.

subSection.paragraph:
Southwestern Australia is recognised globally as one of the world’s top 25 biodiversity hotspots (
Myers et al. 2000
), based largely on its highly diverse and endemic flora (
Beard et al. 2000
). The entire area is effectively a relatively damp ‘island’ refuge surrounded by oceans and desert (
Hopper & Gioia 2004
). Despite the overall regional herpetofaunal diversity being considered impoverished due to the cooler climatic conditions (
How et al. 1987
;
Chapman & Newbey 1995
), the area supports exceptional endemism with several monotypic species including frogs (e.g.
Metacrinia nichollsi (Harrison)
,
Myobatrachus gouldii (Gray)
and
Spicospina flammocaerulea Roberts, Horwitz, Wardell-Johnson, Maxson & Mahony
), turtles (e.g.
Pseudemydura umbrina Siebenrock
), lizards (e.g.
Hesperoedura reticulata (Bustard))
and snakes (e.g.
Paroplocephalus atriceps (Storr)
and
Rhinoplocephalus bicolor Müller
) and species with very restricted distributions (e.g.
Kay & Keogh 2012
;
Doughty & Oliver 2013
).

